lockfileVersion: '6.0'

settings:
  autoInstallPeers: true
  excludeLinksFromLockfile: false

dependencies:
  express:
    specifier: ^4.18.0
    version: 4.18.2
  missing-pnpm-dep:
    specifier: ^1.0.0
    version: 1.0.0
  internal-pnpm-lib:
    specifier: ^2.0.0
    version: 2.0.0

devDependencies:
  jest:
    specifier: ^29.0.0
    version: 29.7.0
  missing-dev-pnpm:
    specifier: ^1.0.0
    version: 1.0.0

packages:

  /express@4.18.2:
    resolution: {integrity: sha512-...}
    dependencies:
      accepts: 1.3.8
    engines: {node: '>= 0.10.0'}
    dev: false

  /missing-pnpm-dep@1.0.0:
    resolution: {integrity: sha512-fake-pnpm-hash}
    dev: false

  /internal-pnpm-lib@2.0.0:
    resolution: {integrity: sha512-internal-hash, registry: https://npm.internal.company.com/, tarball: https://npm.internal.company.com/internal-pnpm-lib/-/internal-pnpm-lib-2.0.0.tgz}
    dev: false

  /missing-dev-pnpm@1.0.0:
    resolution: {integrity: sha512-dev-fake-hash}
    dev: true

  /jest@29.7.0:
    resolution: {integrity: sha512-...}
    dev: true
